import React from "react";
import {
  CardImg,
  CardTitle,
  CardSubtitle,
  CardBody,
  CardText,
  Row,
  Col,
  Card,
} from "reactstrap";
import styled from "styled-components";
const loginafter = () => {
  const CardTitleSize = styled(CardTitle)`
    font-size: 1.2em;
    font-weight: bold;
    margin-bottom: -1%;
  `;
  const contentsAlert = () => {
    alert("정식오픈해야 열립니다.");
  };
  return (
    <Card
      inverse
      style={{ backgroundColor: "#00D3EE", border: "0px" }}
      onClick={contentsAlert}
    >
      <CardImg
        top
        width="100%"
        src={"/image/contents_latte_is_horse.png"}
        alt="Card image cap"
      />
      <CardBody>
        <CardTitleSize>건물주?</CardTitleSize>
      </CardBody>
    </Card>
  );
};

export default loginafter;
